// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.6.0 <0.8.0;
// ABIEncoderV2 is necessary for returning structs in functions. This will be
// the default in 0.8.0 and is no longer experimental:
// https://blog.soliditylang.org/2020/12/16/solidity-v0.8.0-release-announcement/
pragma abicoder v2;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";

/// @author Will Papper and Syndicate Inc.
/// @title SPV management contract
contract SyndicateSPV is OwnableUpgradeable, PausableUpgradeable {
    // Use OpenZeppelin SafeMath library for uint
    using SafeMathUpgradeable for uint256;

    // Use a consistent denominator for the profit share calculations
    uint256 constant PROFIT_SHARE_DENOMINATOR = 10000 ether;

    // This is a placeholder for Will's personal wallet and *must* be changed
    // before launch
    address constant SYNDICATE_FEE_ADDRESS =
        0xdd3767ABcAB26f261e2508A1DA1914053c7DDa78;

    // If you make any changes to SPVValues, ensure that you update
    // getSPVValues as well
    struct SPVValues {
        // The address used for tracking deposits. A stablecoin is recommended
        // since this is used to calculate ownership, and fluctations in value
        // can affect these ownership calculations
        address depositERC20ContractAddress;
        // The maximum amount that a single address can deposit. This is useful
        // when you want to restrict the amount that each wallet can deposit
        // into the fund to ensure that ownership is distributed among many
        // people. In the future, we can consider having a mapping that allows
        // you to set per-user deposit thresholds but this is better saved for
        // the asset management contract.
        uint256 maxDeposit;
        // The maximum amount that a fund can raise
        uint256 maxTotalDeposits;
        // The total deposits are used for calculating percentage stakes (e.g. ownership)
        uint256 totalDeposits;
        uint256 closeDate;
        uint256 syndicateProfitSharePercent;
        // A standard structure would be a 2% management fee and a 20%
        // performance fee. For more info, see:
        // https://www.investopedia.com/terms/t/two_and_twenty.asp
        uint256 managerManagementFeePercent;
        uint256 managerPerformanceFeePercent;
        // The threshold for distributions after which managers receive
        // performance fees
        // 0 is for the deposit ERC20 address, 1 is for all other ERC20
        // addresses
        uint256[2] managerPerformanceThreshold;
        address currentManager;
        // Used to transition ownership of an SPV. A new current manager needs
        // to claim the SPV after being assigned as a pending manager
        address pendingManager;
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the SPV's assets with
        // the manager's profits
        address managerFeeAddress;
        bool spvOpen;
        bool distributionsEnabled;
        bool allowlistEnabled;
        bool inactive;
        // Track the version number for future schema migrations
        uint256 version;
        // Reserve space in the struct so that it is upgrade safe
        // See https://forum.openzeppelin.com/t/how-to-use-a-struct-in-an-upgradable-contract/832/5
        // Gas usage for createSPV without reservations: 130549 gwei
        // Gas usage for createSPV with reservations: 130549 gwei
        // These reservations consume no gas.
        // There is more info on how empty arrays are handled here:
        // https://www.reddit.com/r/ethereum/comments/7f9xjl/evm_question_static_vs_dynamic_arrays/
        uint256[20] __reservedUint256;
        address[20] __reservedAddress;
    }

    // If you make any changes to SPVMappings, ensure that you update getSPVMappings
    // as well
    // This struct is separate from the SPV settings struct because it contains
    // a mapping. Mappings in structs create a whole host of issues in terms of
    // how they can be returned, so it's convenient to separate the mappings
    // from the rest of the struct
    struct SPVMappings {
        // Mapping is the ERC20 contract address -> whether it is available for
        // distributions.
        mapping(address => bool) distributionERC20ContractAddresses;
        // Mapping is the ERC20 contract address -> the amount available as a
        // distribution
        mapping(address => uint256) totalDistributions;
        mapping(address => uint256) totalUnclaimedDistributions;
        // Tracks the amount that an LP has put into a SPV
        mapping(address => uint256) deposits;
        // Tracks the amount that an address has claimed for a specific ERC20
        // contract address
        mapping(address => mapping(address => uint256)) claimedDistributions;
        // The addresses that are approved to contribute to the SPV
        // The allowlist is enabled when allowlistEnabled is true
        // We don't maintain a specific blocklist because someone could
        // trivially create new addresses
        mapping(address => bool) allowedAddresses;
        // Generic metadata mapping for storing arbitrary data
        mapping(string => string) metadata;
        // Track the version number for future schema migrations
        uint256 version;
        // Reserve space in the struct so that it is upgrade safe
        // See https://forum.openzeppelin.com/t/how-to-use-a-struct-in-an-upgradable-contract/832/5
        mapping(address => uint256) reservedAddressUint256MappingZero;
        mapping(address => uint256) reservedAddressUint256MappingOne;
        mapping(address => uint256) reservedAddressUint256MappingTwo;
        mapping(address => uint256) reservedAddressUint256MappingThree;
        mapping(address => uint256) reservedAddressUint256MappingFour;
        mapping(address => bool) reservedAddressBoolMappingZero;
        mapping(address => bool) reservedAddressBoolMappingOne;
        mapping(address => bool) reservedAddressBoolMappingTwo;
        mapping(address => bool) reservedAddressBoolMappingThree;
        mapping(address => bool) reservedAddressBoolMappingFour;
    }

    // Map an SPV manager's address to their SPV's settings
    // The mapping's address is determined via the msg.sender that calls createSPV
    mapping(address => SPVValues) spvValues;

    // This mapping must be internal, otherwise you'll get "Stack to deep, try
    // removing local variables" as an error when including a large number of
    // variables in the SPVMappings struct. (This first occurred when we added a
    // 16th variable that was not a bool to SingleSPV). This is because Solidity
    // attempts to generate automatic getters and setters for the mapping and
    // therefore the struct. The result of this is that we need to create our
    // own getters and setters. We also will be unable to instantiate SingleSPV
    // as a local variable inside of any function, which is mitigated by the
    // fact that we always rely on the global spvMappings mapping. Being unable to
    // instantiate the local variable in a function also has less practical
    // impact because the struct must be initialized in storage anyway because
    // "Type struct SyndicateSPV.SPVMappings is only valid in storage because it
    // contains a (nested) mapping."
    // See https://ethereum.stackexchange.com/questions/64496/is-it-possible-to-have-15-variables-in-a-struct-in-solidity
    // A tip off in solving this was that neither structs nor mappings are
    // passed as values to the function.
    // See https://medium.com/coinmonks/stack-too-deep-error-in-solidity-608d1bd6a1ea
    mapping(address => SPVMappings) internal spvMappings;

    // Mapping of current managers, true if a wallet is currently managing an
    // SPV. Manager wallets are required to be unique to prevent commingling of
    // assets between SPVs and to ensure that transparency is provided to the
    // LPs
    mapping(address => bool) currentManagers;

    // Events emitted when LPs invest or withdraw from an SPV. Used to track LP
    // activity, since that cannot be derived from a mapping (there is no way to
    // search a mapping since it contains all possible addresses initialized to
    // default values)
    event lpInvestedInSPV(
        address indexed lpAddress,
        address indexed spvAddress,
        uint256 amountInvested,
        uint256 timestamp
    );

    event lpWithdrewFromSPV(
        address indexed lpAddress,
        address indexed spvAddress,
        uint256 amountWithdrawn,
        address withdrawalERC20ContractAddress,
        uint256 timestamp
    );

    event memo(
        address indexed spvAddress,
        address indexed currentManager,
        bytes32 blake2b328HashPartOne,
        bytes32 blake2b328HashPartTwo,
        uint256 timestamp
    );

    /// @notice Only proceed if the msg.sender is the current manager
    modifier rejectIfNotCurrentManager(address spvAddress) {
        require(
            msg.sender == spvValues[spvAddress].currentManager,
            "ERR_SENDER_NOT_CURRENT_MANAGER"
        );
        _;
    }

    /// @notice Only proceed if the SPV is open
    modifier onlySPVOpen(address spvAddress) {
        closeSPVIfPastCloseDate(spvAddress);
        // Require that the SPV is open to continue
        require(spvValues[spvAddress].spvOpen, "ERR_SPV_NOT_OPEN");
        _;
    }

    /// @notice Only proceed if the SPV is closed
    modifier onlySPVClosed(address spvAddress) {
        closeSPVIfPastCloseDate(spvAddress);
        // Require that the SPV is closed to continue
        require(!spvValues[spvAddress].spvOpen, "ERR_SPV_NOT_CLOSED");
        _;
    }

    /// @notice Only proceed if distributions have not been enabled
    modifier onlyBeforeDistributionsEnabled(address spvAddress) {
        closeSPVIfPastCloseDate(spvAddress);
        require(
            !spvValues[spvAddress].distributionsEnabled,
            "ERR_DISTRIBUTIONS_ALREADY_ENABLED"
        );
        _;
    }

    /// @notice Only proceed after distributions have been enabled
    modifier onlyAfterDistributionsEnabled(address spvAddress) {
        closeSPVIfPastCloseDate(spvAddress);
        require(
            spvValues[spvAddress].distributionsEnabled,
            "ERR_DISTRIBUTIONS_NOT_ENABLED"
        );
        _;
    }

    /// @notice Only proceed if the allowlist is enabled
    modifier onlyAllowlistEnabled(address spvAddress) {
        // Require that the SPV has an allowlist to continue
        require(
            spvValues[spvAddress].allowlistEnabled,
            "ERR_ALLOWLIST_NOT_IN_USE"
        );
        _;
    }

    /// @notice Only proceed if the allowlist is disabled
    modifier onlyAllowlistDisabled(address spvAddress) {
        // Require that the SPV has an allowlist to continue
        require(
            !spvValues[spvAddress].allowlistEnabled,
            "ERR_ALLOWLIST_IN_USE"
        );
        _;
    }

    /// @notice Only proceed if the LP attests that they are an accredited
    /// investor
    modifier onlyAccredited(bool accredited) {
        // Require that accredited is true to continue
        require(accredited, "ERR_LP_MUST_BE_ACCREDITED");
        _;
    }

    /// @dev This check should always occur before checking if the SPV is open or closed
    function closeSPVIfPastCloseDate(address spvAddress) internal {
        // Check if an SPV is *past* the close date (if the close date is equal
        // to the current block timestamp, the SPV will remain open)
        if (
            spvValues[spvAddress].spvOpen == true &&
            block.timestamp > spvValues[spvAddress].closeDate
        ) {
            spvValues[spvAddress].spvOpen = false;
        }
    }

    /// @param primaryERC20ContractAddress The address of the ERC20 used for
    /// deposits (e.g. DAI or USDC's contract addresses) and withdrawals.
    /// Stablecoins are strongly recommended, especially for funds that are open
    /// for an extended period of time. (Otherwise one contributor might
    /// contribute one unit when a token is $100, and another contributor might
    /// contribute one unit when a token is $200, and they would have the same
    /// percentage ownership because they have both contributed one unit of a
    /// token. Stablecoins prevent this because the value is consistent.)
    /// @param syndicateProfitSharePercent The Syndicate profit share adjusted by
    /// PERCENT_MULTIPLE (set to 1000). For example, the minimum profit share of
    /// .30% should be passed in as 300 (since it is .30% * 1000). This means
    /// that the max precision is .001%
    /// @param closeDate The date that the SPV will automatically close in UNIX time.
    /// @param maxDeposit The max deposit per wallet address.
    /// @param maxTotalDeposits The max deposit amount for the fund/SPV.
    /// @param allowlistEnabled False allows contributions to be sent without the manager needing to allow them. The manager can always reject a contribution before an SPV closes with rejectLPInvestment()
    /// @dev The rejectIfNotCurrentManager modifier is not necessary here since the SPV is being initialized and has not been created yet
    /// @dev This function is high risk. If a current SPV can be overwritten, someone could take control of the deposits by changing the current manager
    function createSPV(
        address primaryERC20ContractAddress,
        uint256 syndicateProfitSharePercent,
        uint256 closeDate,
        uint256 maxDeposit,
        uint256 maxTotalDeposits,
        bool allowlistEnabled
    ) public whenNotPaused() {
        // HIGH RISK: Without this line, an SPV can be overwritten and the deposits can be redirected
        require(
            spvValues[msg.sender].currentManager == address(0),
            "ERR_CURRENT_MANAGER_ALREADY_PRESENT"
        );

        // Ensure that the wallet address is unique to this SPV
        require(
            currentManagers[msg.sender] == false,
            "ERR_CURRENT_MANAGER_ALREADY_MANAGING_ONE_SPV"
        );

        require(
            closeDate > block.timestamp,
            "ERR_CLOSE_DATE_MUST_BE_AFTER_BLOCK_TIMESTAMP"
        );

        require(
            syndicateProfitSharePercent >= 300 ether,
            "Syndicate profit share must be greater than or equal to 300 (0.30%)"
        );
        spvValues[msg.sender].currentManager = msg.sender;
        // Specify that the msg.sender is now managing a fund
        currentManagers[msg.sender] == true;
        spvValues[msg.sender]
            .depositERC20ContractAddress = primaryERC20ContractAddress;
        spvMappings[msg.sender].distributionERC20ContractAddresses[
            primaryERC20ContractAddress
        ] = true;
        spvValues[msg.sender]
            .syndicateProfitSharePercent = syndicateProfitSharePercent;
        spvValues[msg.sender].spvOpen = true;
        spvValues[msg.sender].closeDate = closeDate;
        spvValues[msg.sender].allowlistEnabled = allowlistEnabled;
        spvValues[msg.sender].maxDeposit = maxDeposit;
        spvValues[msg.sender].maxTotalDeposits = maxTotalDeposits;
        // Set schema version to V1
        spvValues[msg.sender].version = 1;
        spvMappings[msg.sender].version = 1;
    }

    /// @notice Allow an LP to invest in an SPV
    /// @param spvAddress The address that the LP is investing in
    /// @param amount The amount of the investment (note that this is calculated
    /// using the primary ERC20 token)
    /// @param accredited Attestation that the LP is an accredited investor. Must
    /// be true to continue
    /// @dev Consider removing the onlySPVOpen modifier since the processDeposit
    /// function has the same modifier, if you want to save on gas costs. Right
    /// now, the duplicate modifiers provide additional safety when developing at
    /// the cost of a small increase in gas.
    function lpInvestInSPV(
        address spvAddress,
        uint256 amount,
        bool accredited
    ) public onlySPVOpen(spvAddress) onlyAccredited(accredited) {
        if (
            !spvValues[spvAddress].allowlistEnabled ||
            spvMappings[spvAddress].allowedAddresses[msg.sender]
        ) {
            // Check if  LP Address maxDeposit will be exceeded on deposit
            // ensures LP doesn't deposit more than the SPV allows for each address
            require(
                spvValues[spvAddress].maxDeposit >=
                    SafeMathUpgradeable.add(
                        spvMappings[spvAddress].deposits[msg.sender],
                        amount
                    ),
                "ERR_MAX_DEPOSIT_REACHED_FOR_LP_ADDRESS"
            );
            // Check if SPV max fund has been reached
            // ensures LP can't deposit beyond the SPV threshold
            require(
                spvValues[spvAddress].maxTotalDeposits >=
                    SafeMathUpgradeable.add(
                        spvValues[spvAddress].totalDeposits,
                        amount
                    ),
                "ERR_MAX_TOTAL_DEPOSIT_REACHED_FOR_SPV"
            );

            processDeposit(
                spvAddress,
                spvValues[spvAddress].currentManager,
                spvValues[spvAddress].depositERC20ContractAddress,
                amount
            );
        } else {
            require(
                spvMappings[spvAddress].allowedAddresses[msg.sender],
                "ERR_LP_NOT_ALLOWED"
            );
        }
    }

    /// @notice Withdrawal options are different if the SPV is open or closed. If it is open, only the deposit ERC20 can be withdrawn. If it is closed and distributions are disabled, no ERC20s of any kind can be withdrawn. If it is closed and distributions are enabled, any ERC20 address can be withdrawn. Distributions can be enabled by setting a distribution for the first time.
    /// @dev Withdrawals are restricted to the primary or secondary ERC20
    /// contract address. If we allowed any arbitrary ERC20 address, we would
    /// also need to track percentages for each arbitrary ERC20 address. This is
    /// significantly outside of the scope of the SPV contract and should be
    /// saved for future asset management contracts
    function lpWithdrawFromSPV(
        address spvAddress,
        address erc20ContractAddress,
        uint256 amount
    ) public {
        // This check is also handled in processWithdrawal below. We could
        // consider removing it from here
        require(
            erc20ContractAddress ==
                spvValues[spvAddress].depositERC20ContractAddress ||
                spvMappings[spvAddress].distributionERC20ContractAddresses[
                    erc20ContractAddress
                ],
            "ERR_CLOSED_SPV_CAN_ONLY_WITHDRAW_DEPOSIT_OR_DISTRIBUTION_ERC20"
        );
        processWithdrawal(spvAddress, erc20ContractAddress, amount);
    }

    /// @notice This is only used when the allowlist is disabled. When an allowlist
    /// is enabled, LPs have already been pre-approved so there is no need to reject
    /// investments.
    function rejectLPInvestment(address spvAddress, address lpAddress)
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
        onlyAllowlistDisabled(spvAddress)
    {}

    /// @notice Allowing addresses is unnecessary if you pass in setAutoConfirmDeposit(true)
    function allowAddress(address spvAddress, address lpAddress)
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
        onlyAllowlistEnabled(spvAddress)
    {
        spvMappings[spvAddress].allowedAddresses[lpAddress] = true;
    }

    /// @param spvAddress The address to the SPV that will accept the allowedAdresses
    /// @param lpAddresses and Array/List of addresses to be allowed by the SPV
    /// @notice Allowing addresses is unnecessary if you pass in setAutoConfirmDeposit(true)
    function allowMultipleAddresses(
        address spvAddress,
        address[] memory lpAddresses
    )
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
        onlyAllowlistEnabled(spvAddress)
    {
        for (uint256 i = 0; i < lpAddresses.length; i++) {
            spvMappings[spvAddress].allowedAddresses[lpAddresses[i]] = true;
        }
    }

    /// @notice All addresses are denied by default, so this is only necessary if
    /// you want to remove a previously allowed address
    function denyAddress(address spvAddress, address lpAddress)
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
        onlyAllowlistEnabled(spvAddress)
    {
        spvMappings[spvAddress].allowedAddresses[lpAddress] = false;
    }

    /// @dev Manager fees can only be set higher while the SPV is open to prevent
    /// managers from changing fees on LPs without the ability to act on those
    /// fee changes. The manager can only change fees while LPs still have the
    /// ability to pull their money out. After that point, fees can only be
    /// lowered and not raised.
    function setManagerFees(
        address spvAddress,
        uint256 managerManagementFeePercent,
        uint256 managerPerformanceFeePercent
    ) public rejectIfNotCurrentManager(spvAddress) {
        require(
            managerManagementFeePercent >= 0 &&
                managerPerformanceFeePercent >= 0,
            "ERR_FEES_MUST_BE_GREATER_THAN_OR_EQUAL_TO_0"
        );
        // The manager can only raise the fees after the SPV is open
        if (
            managerManagementFeePercent >
            spvValues[spvAddress].managerManagementFeePercent ||
            managerPerformanceFeePercent >
            spvValues[spvAddress].managerPerformanceFeePercent
        ) {
            require(
                spvValues[spvAddress].spvOpen,
                "ERR_FEES_CAN_ONLY_BE_LOWERED_SPV_MUST_BE_OPEN_TO_RAISE_FEES"
            );
            spvValues[spvAddress]
                .managerManagementFeePercent = managerManagementFeePercent;
            spvValues[spvAddress]
                .managerPerformanceFeePercent = managerPerformanceFeePercent;
        }
        // The manager can lower the fees under any conditions. This line will
        // only execute if the fees are less than or equal to the current fees
        else {
            spvValues[spvAddress]
                .managerManagementFeePercent = managerManagementFeePercent;
            spvValues[spvAddress]
                .managerPerformanceFeePercent = managerPerformanceFeePercent;
        }
    }

    /// @dev The manager can burn the fees or send them to an address that they
    /// do not own if they'd like, there is no requirement that the
    /// managerFeeAddress cannot equal address(0) or e.g. the address of a
    /// charity
    function setManagerFeeAddress(address spvAddress, address managerFeeAddress)
        public
        rejectIfNotCurrentManager(spvAddress)
    {
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the SPV's assets with
        // the manager's profits
        require(
            managerFeeAddress != spvValues[spvAddress].currentManager &&
                managerFeeAddress != spvValues[spvAddress].pendingManager,
            "ERR_MANAGER_FEE_ADDRESS_CANNOT_BE_CURRENT_OR_PENDING_MANAGER"
        );
        spvValues[spvAddress].managerFeeAddress = managerFeeAddress;
    }

    /// @notice Mark a distribution as available
    /// @notice If this function is called before distributions are enabled, it
    /// will automatically enable distributions. Once enabled, distributions
    /// cannot be disabled.
    /// @notice After enabling distributions, the secondary ERC20 address cannot
    /// be changed
    function setDistribution(
        address spvAddress,
        address distributionERC20Address,
        uint256 amount
    ) public rejectIfNotCurrentManager(spvAddress) onlySPVClosed(spvAddress) {
        // Enable distributions if they are currently disabled
        if (!spvValues[spvAddress].distributionsEnabled) {
            spvValues[spvAddress].distributionsEnabled = true;
        }

        IERC20Upgradeable distributionERC20 =
            IERC20Upgradeable(distributionERC20Address);
        // Check distribution amount is less than or equal to the balance and allowance from the ERC20

        uint256 allowance =
            distributionERC20.allowance(
                spvValues[spvAddress].currentManager,
                address(this)
            );
        // The -1 check for the allowance handles unlimited approval in the case
        // of DAI. Note that unlimited approval is not recommended for security
        // reasons, since unlimited approval could allow all tokens to be
        // drained in the case of a bug.
        // For more on infinite approval, see the following resources on DAI:
        // https://docs.makerdao.com/smart-contract-modules/dai-module/dai-detailed-documentation#differences-from-erc-20
        // https://github.com/makerdao/dss/blob/e2cdd97046d456b760c1223b5ffb86c540b9e096/src/dai.sol#L78
        // TODO: Review unlimited approval check below to ensure that it is
        // correct. This should be checked in the tests.
        require(
            amount <= allowance || allowance == uint256(-1),
            "ERR_AMOUNT_GREATER_THAN_ALLOWANCE"
        );

        uint256 balance =
            distributionERC20.balanceOf(spvValues[spvAddress].currentManager);
        require(amount <= balance, "ERR_AMOUNT_GREATER_THAN_BALANCE");

        // If the allowance and balance checks pass, proceed with marking the distribution as available and emitting an event
        // Only set the distribution ERC20 Contract Address if it was previously unset
        if (
            !spvMappings[spvAddress].distributionERC20ContractAddresses[
                distributionERC20Address
            ]
        ) {
            spvMappings[spvAddress].distributionERC20ContractAddresses[
                distributionERC20Address
            ] = true;
            // TODO: Emit event that a new distribution ERC20 address has been sent
        }

        // HIGH RISK: It is important to keep the total and unclaimed distributions
        // values in sync when a new distribution is added
        spvMappings[spvAddress].totalDistributions[
            distributionERC20Address
        ] = spvMappings[spvAddress].totalDistributions[distributionERC20Address]
            .add(amount);

        spvMappings[spvAddress].totalUnclaimedDistributions[
            distributionERC20Address
        ] = spvMappings[spvAddress].totalUnclaimedDistributions[
            distributionERC20Address
        ]
            .add(amount);
    }

    /// @notice Close an SPV to new deposits. An SPV must be closed before
    /// distributions can be redeemed.
    /// @notice Once an SPV is closed, it cannot be opened again. This is to
    /// prevent issues with redeeming distributions interacting with new deposits
    /// (e.g. a user with a 10% stake performs a withdrawal, and then a deposit
    /// occurs that dilutes them down to a 1% stake. From that point onward, they
    /// would only be entitled to 1% of the distributions)
    function closeSPV(address spvAddress)
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
    {
        spvValues[spvAddress].spvOpen = false;
    }

    /// @notice The current manager is pending until they claim the
    /// currentManager status. This ensures that the new current manager has
    /// control over their wallet and has also agreed to manage the fund.
    /// @notice To reset a pendingManager request, just set the pendingManager to
    /// be address(0). This is the value that it is initialized at within the
    /// SingleSPV struct (it is the default value for all addresses)
    function setPendingManager(address spvAddress, address pendingManager)
        public
        rejectIfNotCurrentManager(spvAddress)
    {
        require(
            currentManagers[pendingManager] == false,
            "ERR_PENDING_MANAGER_ALREADY_MANAGES_ONE_FUND"
        );
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the SPV's assets with
        // the manager's profits
        require(
            pendingManager != spvValues[spvAddress].managerFeeAddress,
            "ERR_PENDING_MANAGER_CANNOT_EQUAL_MANAGER_FEE_ADDRESS"
        );
        spvValues[spvAddress].pendingManager = pendingManager;
    }

    /// @notice Used by the pending manager to claim current manager status
    function confirmPendingManager(address spvAddress) public {
        // Local variables with a value type (like addresses) are stored in
        // memory. We don't need to (and in fact, cannot) specify this
        // explicitly for addresses
        address oldCurrentManager = spvValues[spvAddress].currentManager;
        address newCurrentManager = spvValues[spvAddress].pendingManager;

        // HIGH RISK: Without this line, anyone could steal a fund from a
        // pendingManager
        require(
            msg.sender == newCurrentManager,
            "ERR_MSG_SENDER_IS_NOT_PENDING_MANAGER"
        );
        require(
            currentManagers[newCurrentManager] == false,
            "ERR_MSG_SENDER_ALREADY_MANAGES_ONE_FUND"
        );
        // The manager must set a fee address that is different from the
        // manager's address. This is to avoid commingling the SPV's assets with
        // the manager's profits
        require(
            msg.sender != spvValues[spvAddress].managerFeeAddress,
            "ERR_MSG_SENDER_CANNOT_EQUAL_MANAGER_FEE_ADDRESS"
        );

        // We use spvValues[spvAddress].pendingManager here (stored as
        // newCurrentManager) to ensure that a failure of the require statement
        // above does not lead to the fund being stolen by the msg.sender. We do
        // not set the currentManager to be msg.sender, in case we fail to
        // properly check that newCurrentManager is the msg.sender
        spvValues[spvAddress].currentManager = newCurrentManager;

        currentManagers[newCurrentManager] == true;
        currentManagers[oldCurrentManager] == false;
    }

    function setAutoConfirmDeposit(address spvAddress, bool allowlistEnabled)
        public
        rejectIfNotCurrentManager(spvAddress)
        onlySPVOpen(spvAddress)
    {
        spvValues[spvAddress].allowlistEnabled = allowlistEnabled;
    }

    /// @notice Mark an SPV as inactive. This signals that the SPV is no longer
    /// in use. This only changes the UI that end users see and has no practical
    /// implementation. If you would like to shut down a SPV, you should close
    /// the SPV and enable distributions instead.
    /// @param spvAddress The address of the SPV
    /// @param inactiveStatus Pass in true to mark the SPV as inactive. False
    /// (the default value upon SPV initialization) marks the SPV as active.
    function setSPVInactiveStatus(address spvAddress, bool inactiveStatus)
        public
        rejectIfNotCurrentManager(spvAddress)
    {
        spvValues[spvAddress].inactive = inactiveStatus;
    }

    function setMetadata(
        address spvAddress,
        string calldata metadataKey,
        string calldata metadataValue
    ) public rejectIfNotCurrentManager(spvAddress) {
        spvMappings[spvAddress].metadata[metadataKey] = metadataValue;
    }

    /// @notice Emit an event that references a memo stored as 64 byte hash. IPFS
    /// is recommended. If an IPFS hash is used, it must be `blake2b-328` so that
    /// it can be stored in 64 bytes
    /// @notice This can be used to store a fund thesis or describe a transaction
    /// that a fund manager made in their wallet. This provides transparency by
    /// notifying LPs of transactions and allowing them to verify the proper use
    /// of funds.
    /// @dev For more on the recommendation to use `blake2b-328` hashes, see
    /// https://medium.com/temporal-cloud/efficient-usable-and-cheap-storage-of-ipfs-hashes-in-solidity-smart-contracts-eb3bef129eba
    function emitMemo(
        address spvAddress,
        bytes32 blake2b328HashPartOne,
        bytes32 blake2b328HashPartTwo
    ) public rejectIfNotCurrentManager(spvAddress) {
        emit memo(
            spvAddress,
            msg.sender,
            blake2b328HashPartOne,
            blake2b328HashPartTwo,
            block.timestamp
        );
    }

    /// @notice Return the settings for an SPV
    /// @param spvAddress The address of the SPV
    /// @return SPVValues struct
    /// @dev This function **must** be kept up to date with the web3 UI when
    /// making changes. All PRs that change this function **must** be coordinated
    /// with an engineer on the Web3 Dashboard.
    function getSPVValues(address spvAddress)
        public
        view
        returns (SPVValues memory)
    {
        return spvValues[spvAddress];
    }

    /// @notice Return the LP info for an SPV
    /// @param spvAddress The address of the SPV
    /// @param lpAddress The address of the LP
    /// @return Tuple of:
    /// spvMappings[spvAddress].deposits[lpAddress],
    /// spvMappings[spvAddress].claimedPrimaryDistributions[lpAddress],
    /// spvMappings[spvAddress].claimedSecondaryDistributions[lpAddress],
    /// spvMappings[spvAddress].allowedAddresses[lpAddress]
    /// @dev This function **must** be kept up to date with the web3 UI when
    /// making changes. All PRs that change this function **must** be coordinated
    /// with an engineer on the Web3 Dashboard.
    function getSPVLPInfo(address spvAddress, address lpAddress)
        public
        view
        returns (
            uint256,
            uint256,
            bool
        )
    {
        return (
            spvMappings[spvAddress].deposits[lpAddress],
            spvMappings[spvAddress].claimedDistributions[lpAddress][
                spvValues[spvAddress].depositERC20ContractAddress
            ],
            spvMappings[spvAddress].allowedAddresses[lpAddress]
        );
    }

    function getClaimedDistributions(
        address spvAddress,
        address lpAddress,
        address distributionERC20ContractAddress
    ) public view returns (uint256) {
        return
            spvMappings[spvAddress].claimedDistributions[lpAddress][
                distributionERC20ContractAddress
            ];
    }

    /// @notice Return the metadata for a given key within an SPV
    /// @param spvAddress The address of the SPV
    /// @param metadataKey The string that is the key of the metadata to look up
    /// @return metadataValue as a string
    function getSPVMetadata(address spvAddress, string calldata metadataKey)
        public
        view
        returns (string memory)
    {
        return spvMappings[spvAddress].metadata[metadataKey];
    }

    /// @notice Process a deposit to an SPV
    /// @param spvAddress The address of the SPV
    /// @param depositERC20ContractAddress The ERC20 contract address of the
    /// token that is being used for the deposit
    /// @param amount The amount that the msg.sender is depositing
    /// @dev The onlySPVOpen modifier is handled by the methods that call this
    /// (lpInvestInSPV). This modifier is a duplicate and could be removed to
    /// save on gas costs, at the expense of possibly introducing bugs in
    /// investing in close SPVs down the road. For safety's sake, we'll keep it
    /// in for now -- investing in a closed SPV causes a whole host of issues,
    /// so it's worth the small increase in gas for the protection that we get
    /// from its presence.
    /// @dev This function is high risk. If the `.transferFrom` line can be
    /// redirected elsewhere, deposits could be stolen. In addition, if the
    /// deposits are not properly tracked, a user could withdraw more than their
    /// allocated share of the distributions.
    function processDeposit(
        address spvAddress,
        address currentManagerAddress,
        address depositERC20ContractAddress,
        uint256 amount
    ) internal whenNotPaused() onlySPVOpen(spvAddress) {
        require(
            depositERC20ContractAddress ==
                spvValues[spvAddress].depositERC20ContractAddress,
            "ERR_ERC20_DOES_NOT_MATCH_DEPOSIT_ERC20"
        );
        IERC20Upgradeable depositERC20 =
            IERC20Upgradeable(
                spvValues[spvAddress].depositERC20ContractAddress
            );

        // We could check the allowance first before calling `transferFrom()` if
        // we wanted to, but this would use up more gas. I believe that the
        // `transferFrom()` should cause a revert if the allowance or balance is
        // insufficient, so we don't need to conduct a check here for it. We do
        // need to ensure that everything related to a confirmed transaction
        // occurs after `transferFrom()`

        // HIGH RISK: If we did not use `msg.sender`, this could be used to
        // steal funds from users other than the wallet holder (or smart
        // contract owner, if a DAO is making the deposit).
        depositERC20.transferFrom(msg.sender, currentManagerAddress, amount);

        // Increase the deposits after a transferFrom. The transferFrom will
        // have reverted upon failure, so we can allow this to proceed.

        // Increase the deposit total for the LP
        spvMappings[spvAddress].deposits[msg.sender] += amount;
        // Increase the total deposits. It's *very important* to keep this in
        // sync with the LP deposits. If these values are out of sync, we cannot
        // calculate percentage ownership of an SPV properly
        spvValues[spvAddress].totalDeposits += amount;

        // Emit LP invested in SPV event
        emit lpInvestedInSPV(msg.sender, spvAddress, amount, block.timestamp);
    }

    /// @notice Withdraws deposits from an open fund in primary tokens;
    /// transfers distributions from a closed fund in either primary or
    /// secondary tokens.
    /// @param spvAddress The address of the SPV
    /// @param withdrawalERC20ContractAddress The address of the tokens
    /// awaiting distribution.  This parameter implicitly specifies the type of
    /// distribution (i.e. in primary or secondary tokens) that is being
    /// withdrawn.
    /// @param amount Amount in primary or secondary distribution tokens (as
    /// specified by withdrawalERC20ContractAddress)
    /// @dev This function is high risk. If the `.transferFrom` line can be
    /// redirected elsewhere, withdrawals could be stolen. In addition, if the
    /// withdrawals are not properly tracked, a user could withdraw more than
    /// their allocated share of the distributions.
    function processWithdrawal(
        address spvAddress,
        address withdrawalERC20ContractAddress,
        uint256 amount
    ) internal whenNotPaused() {
        // If the SPV is open, you can withdraw the primary ERC20 token to take
        // your money back. This is deducted from your deposit. Because you are
        // receiving your money back before there are any profits, there are no
        // fees associated with this action.
        if (spvValues[spvAddress].spvOpen) {
            // Ensure that the primary ERC20 is the only withdrawal option
            // before a fund closes (otherwise a user could take secondary
            // tokens before they are distributed)
            require(
                spvValues[spvAddress].depositERC20ContractAddress ==
                    withdrawalERC20ContractAddress,
                "ERR_OPEN_SPV_CAN_ONLY_WITHDRAW_DEPOSIT_ERC20"
            );

            // HIGH RISK: Without this line, a user could withdraw more than
            // they put into the fund
            require(
                amount <= spvMappings[spvAddress].deposits[msg.sender],
                "ERR_WITHDRAWAL_AMOUNT_GREATER_THAN_DEPOSIT"
            );

            // Rely on the primaryERC20ContractAddress since that is the only
            // allowed option when a fund is open
            IERC20Upgradeable withdrawalERC20 =
                IERC20Upgradeable(
                    spvValues[spvAddress].depositERC20ContractAddress
                );

            // HIGH RISK: If we did not use `msg.sender`, this could be used to
            // redirect funds from users other than the wallet holder (or smart
            // contract owner, if a DAO is making the withdrawal).
            withdrawalERC20.transferFrom(
                spvValues[spvAddress].currentManager,
                msg.sender,
                amount
            );

            // Decrease the deposits after a transferFrom. The transferFrom will
            // have reverted upon failure, so we can allow this to proceed.

            // Decrease the deposit total for the LP
            spvMappings[spvAddress].deposits[msg.sender] -= amount;
            // Decrease the total deposits. It's *very important* to keep this
            // in sync with the LP deposits. If these values are out of sync,
            // we cannot calculate percentage ownership of an SPV properly.
            spvValues[spvAddress].totalDeposits -= amount;

            // Emit LP withdrew from SPV event
            emit lpWithdrewFromSPV(
                msg.sender,
                spvAddress,
                amount,
                withdrawalERC20ContractAddress,
                block.timestamp
            );
        }
        // If the SPV is closed but distributions have not been enabled, the SPV
        // manager needs the SPVs for investment. Therefore, the funds cannot be
        // withdrawn until the SPV manager enables distributions.
        else if (
            !spvValues[spvAddress].spvOpen &&
            !spvValues[spvAddress].distributionsEnabled
        ) {
            revert("ERR_SPV_CLOSED_BUT_DISTRIBUTIONS_NOT_ENABLED");
        }
        // If the SPV is closed and distributions are enabled, funds can be
        // withdrawn in the primary or secondary ERC20 token. This is added
        // to the sender's claimed distribution totals to track the remaining
        // amount they are eligible to withdraw. Fees are sent to the manager
        // and Syndicate upon withdrawal.
        else if (
            !spvValues[spvAddress].spvOpen &&
            spvValues[spvAddress].distributionsEnabled
        ) {
            require(
                spvMappings[spvAddress].distributionERC20ContractAddresses[
                    withdrawalERC20ContractAddress
                ],
                "ERR_MANAGER_MUST_SET_DISTRIBUTION_FOR_WITHDRAWAL_ERC20"
            );
            // If this error is thrown, then we have not properly
            // tracked totalUnclaimedDistributions[erc20Index].
            require(
                amount <=
                    spvMappings[spvAddress].totalUnclaimedDistributions[
                        withdrawalERC20ContractAddress
                    ],
                "ERR_INSUFFICIENT_UNCLAIMED_DISTRIBUTIONS"
            );
            // HIGH RISK: Without this line, a user could withdraw more than
            // they are eligible to.
            require(
                amount <=
                    calculateEligibleWithdrawal(
                        spvMappings[spvAddress].deposits[msg.sender],
                        spvValues[spvAddress].totalDeposits,
                        spvMappings[spvAddress].claimedDistributions[
                            msg.sender
                        ][withdrawalERC20ContractAddress],
                        spvMappings[spvAddress].totalDistributions[
                            withdrawalERC20ContractAddress
                        ]
                    ),
                "ERR_WITHDRAWAL_AMOUNT_GREATER_THAN_ELIGIBLE"
            );

            IERC20Upgradeable withdrawalERC20 =
                IERC20Upgradeable(withdrawalERC20ContractAddress);

            uint256 amountToSyndicate;
            uint256 amountToManager;
            uint256 amountToUser;

            // Tuples are not proper types on Solidity, so we cannot access
            // them by quering the index of the tuple
            // https://docs.soliditylang.org/en/latest/control-structures.html#assignment
            (, amountToSyndicate) = calculateProfitShare(
                amount,
                spvValues[spvAddress].syndicateProfitSharePercent
            );
            (, amountToManager) = calculateProfitShare(
                amount,
                spvValues[spvAddress].managerPerformanceFeePercent
            );
            // Get amount by subtracting from the manager and the Syndicate
            // profit shares. This is a protection against errors in the fee
            // calculation.
            amountToUser = amount.sub(amountToSyndicate).sub(amountToUser);

            // Additional sanity check to ensure that the user is not
            // withdrawing an amount greater than what they're entitled to
            // or withdrawing a negative amount. There are cases where a
            // user may withdraw 0 (e.g. If Syndicate or the manager
            // receives 100% of the distributions, in the case of a charity)
            require(
                (amount >= amountToUser && amountToUser >= 0),
                "ERR_AMOUNT_TO_USER_HIGHER_THAN_WITHDRAWAL_AMOUNT_OR_LESS_THAN_ZERO"
            );
            // I believe that there are cases where this can fail (e.g. if
            // there is wei left over from truncating the division). We can
            // catch this during formal verification and determine whether
            // we want to make amount >= instead of == or just give the
            // remaining wei to the user
            require(
                amount ==
                    amountToSyndicate.add(amountToManager).add(amountToUser),
                "WITHDRAWAL_AMOUNT_IS_NOT_EQUAL_TO_TOTAL_AMOUNTS_AFTER_FEES"
            );

            // The user should get paid first, then Syndicate, then the
            // manager. This is because the manager controls the allowance --
            // otherwise the manager could stop someone from getting paid by
            // lowering the allowance below the distribution amount. If the
            // manager wants to get paid, they need to set a proper
            // allowance and not have any of these transfers fail.
            // HIGH RISK: If we did not use `msg.sender`, this could be
            // used to redirect funds from users other than the wallet
            // holder (or smart contract owner, if a DAO is making the
            // withdrawal).
            withdrawalERC20.transferFrom(
                spvValues[spvAddress].currentManager,
                msg.sender,
                amountToUser
            );

            // Increase the claimed distributions after a transferFrom. The
            // transferFrom will have reverted upon failure, so we can
            // allow this to proceed.
            // HIGH RISK: We increase the amounts after each transferFrom to
            // ensure that the amounts are accurately recorded if a single
            // transferFrom fails. If we increased the amounts after the
            // transferFrom sequence, any one of the transferFrom calls
            // failing would cause the entire withdrawal to go unrecorded
            spvMappings[spvAddress].claimedDistributions[msg.sender][
                withdrawalERC20ContractAddress
            ] = SafeMathUpgradeable.add(
                spvMappings[spvAddress].claimedDistributions[msg.sender][
                    withdrawalERC20ContractAddress
                ],
                amountToUser
            );

            // Increase the LP's claimed distributions
            // Subtract from SPV's total distributions available.  It is
            // *very important* to keep this in sync with the LP claimed
            // distributions. If these values are out of sync, we cannot
            // calculate percentage ownership of an SPV properly.
            spvMappings[spvAddress].totalUnclaimedDistributions[
                withdrawalERC20ContractAddress
            ] = SafeMathUpgradeable.sub(
                spvMappings[spvAddress].totalUnclaimedDistributions[
                    withdrawalERC20ContractAddress
                ],
                amountToUser
            );

            // Follow the same transfer process for the Syndicate
            // distribution share
            withdrawalERC20.transferFrom(
                spvValues[spvAddress].currentManager,
                spvValues[spvAddress].managerFeeAddress,
                amountToSyndicate
            );

            spvMappings[spvAddress].claimedDistributions[msg.sender][
                withdrawalERC20ContractAddress
            ] = SafeMathUpgradeable.add(
                spvMappings[spvAddress].claimedDistributions[msg.sender][
                    withdrawalERC20ContractAddress
                ],
                amountToSyndicate
            );

            withdrawalERC20.transferFrom(
                spvValues[spvAddress].currentManager,
                spvValues[spvAddress].managerFeeAddress,
                amountToManager
            );

            spvMappings[spvAddress].claimedDistributions[msg.sender][
                withdrawalERC20ContractAddress
            ] = SafeMathUpgradeable.add(
                spvMappings[spvAddress].claimedDistributions[msg.sender][
                    withdrawalERC20ContractAddress
                ],
                amountToManager
            );

            // Emit LP withdrew from SPV event
            // This can be used to calculate the total withdrawals for a user
            emit lpWithdrewFromSPV(
                msg.sender,
                spvAddress,
                amount,
                withdrawalERC20ContractAddress,
                block.timestamp
            );
        }
    }

    /// @notice Calculates the maximum value in distribution tokens (in either
    /// primary or secondary ERC20) that an LP can withdraw based on their
    /// percentage ownership at the moment that the fund closed and the
    /// distributions that they have already received.
    /// @param userContributions Total user has deposited to the fund
    /// @param totalContributions Total contributions (from anyone) to the fund
    /// @param claimedDistributions Value in distributions that user has
    /// withdrawn from the fund already.  Make sure this matches the token type
    /// (primary or secondary) passed in for totalDistributions.
    /// @param totalDistributions Total distributions available from the fund,
    /// claimed or not.  Make sure this matches the token type (primary or
    /// secondary) passed in for claimedDistributions.
    /// @return Value in distributions that user is eligible to withdraw
    /// @dev HIGH RISK: If this calculation is incorrect, a user could withdraw
    /// more or less than they are entitled to.
    function calculateEligibleWithdrawal(
        uint256 userContributions,
        uint256 totalContributions,
        uint256 claimedDistributions,
        uint256 totalDistributions
    ) public pure returns (uint256) {
        // If the fund is empty, we need to return to prevent division by 0
        if (totalContributions == 0) return 0;
        // Solves this equation for eligibleWithdrawal:
        // userContributions / totalContributions = (eligibleWithdrawal +
        //      claimedDistributions) / totalDistributions
        uint256 eligibleWithdrawal =
            SafeMathUpgradeable.sub(
                SafeMathUpgradeable.div(
                    SafeMathUpgradeable.mul(
                        userContributions,
                        totalDistributions
                    ),
                    totalContributions
                ),
                claimedDistributions
            );
        require(eligibleWithdrawal > 0, "ERR_NO_ELIGIBLE_WITHDRAWAL");
        return eligibleWithdrawal;
    }

    // TODO: Allow managers to set a profit share to Syndicate that they can only raise, not lower

    /// @param withdrawal Total amount to user is sending
    /// @param profitShareNumerator Establish fractional profit share (decimal
    /// %'s get messy fast). The profit share denominator is always
    /// PROFIT_SHARE_DENOMINATOR, which is set to 10000. Examples of different
    /// percentages can be found in the calculateProfitShare tests
    /// @return Tuple of (withdrawalToUser, withdrawalToProfitShare) The
    /// withdrawal that the user will
    /// receive and the amount of the profit share that the Syndicate treasury
    /// (or, if adapted to asset management, the Syndicate manager) will receive
    /// during withdrawal
    function calculateProfitShare(
        uint256 withdrawal,
        uint256 profitShareNumerator
    ) public pure returns (uint256, uint256) {
        uint256 withdrawalToProfitShare =
            SafeMathUpgradeable.div(
                SafeMathUpgradeable.mul(withdrawal, profitShareNumerator),
                PROFIT_SHARE_DENOMINATOR
            );
        uint256 withdrawalToUser = withdrawal - withdrawalToProfitShare;
        return (withdrawalToUser, withdrawalToProfitShare);
    }

    /// @notice Emergency pause function that can only be triggered by the
    /// contract owner
    /// @notice Its purpose is to pause deposits and withdrawals. All other
    /// functions will work when paused
    function pauseContract() public onlyOwner {
        _pause();
    }

    /// @notice Emergency unpause function that can only be triggered by the
    /// contract owner
    /// @notice Its purpose is to unpause deposits and withdrawals. All other
    /// functions will work when paused
    function unPauseContract() public onlyOwner {
        _unpause();
    }

    /// @notice Renounce ownership of the contract
    /// @notice Unpause the contract before ownership is renounced, to ensure
    /// that deposits/withdrawals are not locked
    function renounceOwnership() public override onlyOwner {
        unPauseContract();
        super.renounceOwnership();
    }

    // Added a storage gap for future variable additions.
    // See https://docs.openzeppelin.com/contracts/3.x/upgradeable#storage_gaps
    uint256[50] __gap;
}

